// import { Provider } from 'mobx-react'; 
import ModalStore from './store/ModalStore';
import { observer } from 'mobx-react';


export default function App({authService}) {
  return (
      <AuthContextProvider>
        <Navbar />
        <Outlet />
      </AuthContextProvider>
  )
};

